  false,\n\t\"url\": null,\n\t\"notes\": \"Colonial nesting bird aerial surveys were
  conducted in northwestern Nevada in 1995. \"Visibility factors\" used to adjust
  raw counts were discontinued. Historical data was adjusted to reflect the new protocol.
  Grebe and tern nesting activity was monitored in FY1995. Shorebird counts for the
  Point Reyes Bird Observatory Pacific Flyway Project continued in FY1995. Participation
  from volunteers was solicited and received. Walker Lake bird surveys were continued
  in FY1995. Efforts to coordinate with the North American Loon Fund concerning the
  unique common loon migration using Walker Lake were initiated and well received.
  The Walker Lake Loon Festival in its expanded format was  conducted for the second
  year, with nationally-renowned loon biologist Judith Mclntyre as guest speaker.\",\n\t\"owner_org\":
